INSERT INTO `psjn_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`) VALUES
(23, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-lapis-lazului', '', '', '', 'Inel cu piatra semipretioasa Lapis Lazului', '', ''),
(23, 1, 2, '<p>Una dintre cele mai vechi pietre din istoria omenirii, lazuritul ramane simbolul regalitatii si al onoarei, al zeilor si al puterii, al spiritului si al intelepciunii. Inca din cele mai vechi timpuri, Lazuritul era cea mai apreciata piatra datorita culorii sale frumoase si a asemanarii sale cu un cerul instelat. Cel mai valoros Lazurit este extras din minele din Afganistan de mai bine de 6000 de ani.</p>', '<p>Inel din argint, cu piatra Lazurit. Elegant si rafinat, acest inel poate fi purtat la o tinuta casual aducand o nota distinctiva personalitatii tale.</p>', 'inel-arabesque-lazurit', 'Indira te inspira cu cea mai veche piatra din istoria umanitatii, a inelului Arabesque din argint, Lazurit. Oferte si promotii pe site', '', 'Inel Arabesque - Lazurit | Indira', 'Inel Arabesque - Lazurit', '', ''),
(24, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-red-corundum', '', '', '', 'Inel cu piatra semipretioasa Red Corundum', '', ''),
(24, 1, 2, '', '<p>Inel din argint, cu piatra semipretioasa din Rubin. <span>Indrazneste sa-ti arati adevarata personalitate si autenticitate si accesorizeaza-te cu Regele pietrelor pretioase, rubinul.</span></p>', 'inel-ruby-square-rubin', 'Inel cu piatra semipretioasa Red Corundum', '', 'Inel cu piatra semipretioasa Red Corundum', 'Inel Ruby Square - Rubin', '', ''),
(25, 1, 1, '', '', 'pandantiv-jade-panther', '', '', '', 'Pandantiv Jade Panther', '', ''),
(25, 1, 2, '', '<p>Pandantiv Jade Panther</p>', 'pandantiv-jade-panther-jad', 'Pandantiv Jade Panther', '', 'Pandantiv Jade Panther', 'Pandantiv Jade Panther - Jad', '', ''),
(26, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-safir-albastru', '', '', '', 'Inel cu piatra semipretioasa safir albastru', '', ''),
(26, 1, 2, '', '<p>Inel din argint cu safire de culoare albastra, fatetate. Lucrat manual de maestri talentati din cele mai indepartate tinuturi, inelul Boho Chic te va face sa stralucesti de fiecare data.</p>', 'inel-boho-chic-safir-albastru', 'Inel cu piatra semipretioasa safir albastru', '', 'Inel cu piatra semipretioasa safir albastru', 'Inel Boho Chic - Safir Albastru', '', ''),
(27, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-rubin', '', '', '', 'Inel cu piatra semipretioasa Rubin', '', ''),
(27, 1, 2, '', '<p>Inel din argint, cu piatra de rubin fatetata. Completeaza-ti tinuta Boho, cu acest inel deosebit. Datorita simplitatii sale, el poate fi purtat in combinatie cu mai multe inele.</p>', 'inel-ruby-boho-rubin', 'Inel cu piatra semipretioasa Rubin', '', 'Inel cu piatra semipretioasa Rubin', 'Inel Ruby Boho - Rubin', '', ''),
(28, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-red-corundum', '', '', '', 'Inel cu piatra semipretioasa Red Corundum', '', ''),
(28, 1, 2, '', '<p>Inel din argint, cu piatra de rubin, fatetata. </p>', 'inel-ruby-drop-rubin', 'Inel cu piatra semipretioasa Red Corundum', '', 'Inel cu piatra semipretioasa Red Corundum', 'Inel Ruby Drop - Rubin', '', ''),
(29, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-mmulti-sapphire', '', '', '', 'Inel cu piatra semipretioasa mmulti sapphire', '', ''),
(29, 1, 2, '<p>Safirul Multi Color este una dintre cele mai dure pietre semipretioase si face parte din clasa de minerale numita Corindon.  In general, toate pietrele din clasa corindon, cu exceptia celor rosii, sunt numite Safire Multi Color.</p>\n<p>Safirul este cunoscut ca piatra intelepciunii si a calmului. Este cunoscut faptul, ca acesta era folosit pentru a calma tensiunile mentale si a alunga gandurile negative. </p>\n<p></p>', '<p>Inel din argint, cu piatra semipretioasa din safir multicolor, fatetata. Inelul Round Multi Color este lucrat manual de cei mai iscusiti maestri si fatetat astfel incat lumina se va reflecta si va face inelul sa straluceasca din fiecare unghi. Inelul vine intr-o forma nedefinita, ceea ce il face sa fie unic si special.</p>', 'inel-round-multi-color-safir', 'Inel din argint, cu piatra semipretioasa din safir multicolor, fatetata. Inelul Round Multi Color este lucrat manual de cei mai iscusiti maestri.', '', 'Inel Round Multi Color - Safir |Indira', 'Inel Round Multi Color - Safir', '', ''),
(30, 1, 1, '', '', 'inel-cu-piatra-semipretioasa-mystic-topaz', '', '', '', 'Inel cu piatra semipretioasa Mystic Topaz', '', ''),
(30, 1, 2, '', '<p>Inel din argint, cu piatra semipretioasa Mystic Topaz. Efectul unic de curcubeu al pietrei, te va face sa te indragostesti de acest inel de la prima vedere. Pe cat de atractiv, pe atat de misterios si deosebit este inelul Mystic Topaz.</p>\n<p></p>', 'inel-mystic-topaz', 'Inelul din argint cu piatra semipretioasa Mystic Topaz de la Indira te va face sa stralucesti cu fiecare ocazie. Oferte si promotii', '', 'Inel Mystic Topaz| Indira', 'Inel Mystic Topaz', '', ''),
(31, 1, 1, '', '', 'pandantiv-rutile', '', '', '', 'Pandantiv Rutile', '', ''),
(31, 1, 2, '<p>Rutilul vine intr-un contrast surprinzator de culori distincte, ceea ce il face un mineral foarte interesant. Incluziunile microscopice creeaza efecte optice rar intalnite precum cel de stea sau de ochi de pisica.</p>', '<p>Pandantiv din argint cu piatra semipretioasa Rutil. Accesorizeaza-ti tinuta de petrecere cu pandantivul Angel Drop pentru un plus de originalitate si autenticitate.</p>', 'pandantiv-angel-drop-rutil', 'Pandantiv din argint cu piatra semipretioasa Rutil. Accesorizeaza-ti tinuta de party cu pandantivul Angel Drop pentru un plus de originalitate si autenticitate.', '', 'Pandantiv Angel Drop - Rutil', 'Pandantiv Angel Drop - Rutil', '', ''),
(32, 1, 1, '', '', 'pandantiv-zebra-jasper', '', '', '', 'Pandantiv Zebra Jasper', '', ''),
(32, 1, 2, '', '<p>Pandantiv din argint, cu piatra semipretioasa Zebra Jasper. Una dintre cele mai frumoase pietre din India, Zebra Jasper este folosita de cei mai iscusiti maestri pentru realizarea acestui pandantiv deosebit. </p>', 'pandantiv-zebra-jasper', 'Una dintre cele mai frumoase pietre din India, Zebra Jasper este folosita de cei mai iscusiti maestri pentru realizarea acestui pandantiv deosebit. ', '', 'Pandantiv Zebra Jasper | Indira', 'Pandantiv Zebra Jasper', '', ''),
(33, 1, 1, '', '', 'pandantiv-larimar', '', '', '', 'Pandantiv Larimar', '', ''),
(33, 1, 2, '', '<p>Pandantiv din argint cu piatra Larimar. Numita si Piatra Delfinului, Larimar este o piatra foarte rar intalnita, mai exact aceasta a fost intalnita intr-un singur loc, o zona muntoasa din Republica Dominicana, provincia Barahona. </p>\n<p></p>\n<p></p>', 'pandantiv-larimar', 'Pandantiv din argint cu piatra Larimar. Numita si Piatra Delfinului, Larimar este o piatra foarte rar intalnita, de o delicatete aparte.', '', 'Pandantiv Larimar | Indira ', 'Pandantiv Larimar', '', ''),
(34, 1, 1, '', '', 'pandantiv-malachite', '', '', '', 'Pandantiv Malachite', '', ''),
(34, 1, 2, '', '<p>Pandantiv din argint, cu piatra Malachit, lucrat manual in India. Acest superb pandantiv reprezinta unul dintre simbolurile spirituale din cultura Indiei, si anume Mandala. Denumita si diagrama cosmica, Mandala simbolizeaza unitatea si armonia, fiind un bun instrument de calatorie spirituala.</p>', 'pandantiv-indian-drop-malachit', 'Pandantiv din argint cu piatra Malachit, in forma de Mandala, simbol spiritual in cultura Indiei.  Poarta pandantivul Indian Drop pentru un plus de originalitate', '', 'Pandantiv Indian Drop - Malachit | Indira', 'Pandantiv Indian Drop - Malachit', '', ''),
(35, 1, 1, '', '', 'pandantiv-shell', '', '', '', 'Pandantiv Shell', '', ''),
(35, 1, 2, '', '<p>Pandantiv din argint, cu scoica si sidef. Potrivit la orice tinuta, de zi sau de seara, Pandantivul Flower Shell aduce un aer misterios, care va atrage toate privirile.</p>', 'pandantiv-flower-shell', 'Pandantiv din argint, cu scoica si sidef. Potrivit la orice tinuta, Pandantivul Flower Shell aduce un aer misterios, care va atrage toate privirile.', '', 'Pandantiv din argint Flower Shell | Indira', 'Pandantiv Flower Shell', '', ''),
(36, 1, 1, '', '', 'pandantiv-ethiopian-opal', '', '', '', 'Pandantiv Ethiopian Opal', '', ''),
(36, 1, 2, '', '<p>Pandantiv din argint, cu opal etiopian, lucrat manual in India. Este imposibil sa nu te indragostesti de acest pandantiv. Opalul etiopian are un farmec aparte care te va cuceri de la prima vedere.</p>', 'pandantiv-vintage-drop-opal-etiopian', 'Este imposibil sa nu te indragostesti de acest pandantiv de la Indira. Opalul etiopian are un farmec aparte care te va cuceri de la prima vedere.', '', 'Pandantiv din argint Vintage Drop - Opal Etiopian | Indira', 'Pandantiv  Vintage Drop - Opal etiopian', '', ''),
(37, 1, 1, '', '', 'pandantiv-turcoaz', '', '', '', 'Pandantiv Turcoaz', '', ''),
(37, 1, 2, '', '<p>Pandantiv din argint, cu pietre de turcoaz si coral. Pandantivul Gypsy Soul este lucrat manual in India, de cei mai priceputi maestri ai bijuteriilor. Frumusetea pietrelor si contrastul lor, sunt conturate de lucratura in detaliu din argint, facand din acest pandantiv, o piesa greu de egalat.</p>', 'pandantiv-gypsy-soul', 'Pandantiv din argint, cu pietre de turcoaz si coral. Pandantivul Gypsy Soul este lucrat manual in India, de cei mai priceputi maestri ai bijuteriilor. ', '', 'Pandantiv Gypsy Soul - Turcoaz, Coral | Indira', 'Pandantiv Gypsy Soul', '', ''),
(38, 1, 1, '', '', 'pandantiv-malachit', '', '', '', 'Pandantiv Malachit', '', ''),
(38, 1, 2, '', '<p>Pandantiv din argint cu piatra Malachit. Lucrat manual cu grija si pricepere de cei mai iscusiti mesteri ai bijuteriilor, pandantivul Indian Soul are un model jucaus de care te vei indragosti imediat ce l-ai pus la gat.</p>', 'pandantiv-indian-soul', 'Pandantiv din argint cu piatra Malachit. Pandantivul Indian Soul de la Indira , este ucrat manual cu grija si pricepere de cei mai iscusiti mesteri bijutieri.', '', 'Pandantiv Indian Soul - Malachit | Indira', 'Pandantiv Indian Soul', '', ''),
(39, 1, 1, '', '', 'pandantiv-turcoaz', '', '', '', 'Pandantiv Turcoaz', '', ''),
(39, 1, 2, '', '<p>Pandantiv din argint cu piatra Turcoaz. Lucrat manual cu grija si pricepere in India, pandantivul Blue Drop este usor de asortat la orice tinuta, de zi sau de seara.</p>', 'pandantiv-blue-drop', 'Pandantiv din argint cu piatra Turcoaz. Lucrat manual cu grija si pricepere in India, pandantivul Blue Drop este usor de asortat la orice tinuta.', '', 'Pandantiv Blue Drop - Turcoaz | Indira', 'Pandantiv Blue Drop', '', ''),
(40, 1, 1, '', '', 'pandantiv-black-onyx', '', '', '', 'Pandantiv Black Onyx', '', ''),
(40, 1, 2, '', '<p>Pandantiv din argint cu onix negru, lucrat manual in India. Elegant si delicat, pandantivul Black Drop te va face sa stralucesti cu fiecare ocazie.</p>', 'pandantiv-black-drop-onix-negru', 'Pandantiv din argint cu onix negru, lucrat manual in India. Elegant si delicat, pandantivul Black Drop te va face sa stralucesti cu fiecare ocazie.', '', 'Pandantiv black Drop - Onix negru | Indira', 'Pandantiv Black drop - Onix negru', '', ''),
(41, 1, 1, '', '', 'pandantiv-labradorite', '', '', '', 'Pandantiv Labradorite', '', ''),
(41, 1, 2, '', '<p>Pandantiv din argint cu pietre Labradorit, lucrat manual in India. Pe langa lucratura delicata din argint, pietrele Labradorit au o frumusete aparte, mistica. Denumita si Piatra neagra a lunii, se zice ca labradoritul a cazut din focul inghetat al Aurorei Boreale si este menita sa separe lumea reala de taramurile nevazute.</p>', 'pandantiv-vintage-charm-labradorit', 'Pandantiv din argint cu pietre Labradorit, lucrat manual in India. Pe langa lucratura delicata din argint, pietrele Labradorit au o frumusete aparte, mistica. ', '', 'Pandantiv Vintage Charm - Labradorit', 'Pandantiv Vintage Charm - Labradorit', '', ''),
(42, 1, 1, '', '', 'pandantiv-lapis-coral-turcuaz', '', '', '', 'Pandantiv Lapis, Coral, Turcuaz', '', ''),
(42, 1, 2, '', '<p>Pandantiv din argint cu pietre de turcoaz, coral si lazurit. Lucrat manual in India, pandantivul este format dintr-o combinatie neasteptata de culori, dandu-i un aer vesel si jucaus. Piatra de turcoaz din centrul pandantivului este delimitata in partea inferioara de lazurit si in partea superioara de coral.</p>', 'pandantiv-arabesque-turcoaz-coral-lazurit', 'Pandantiv din argint cu pietre de turcoaz, coral si lazurit. Pandantivul este format dintr-o combinatie neasteptata de culori, dandu-i un aer vesel si jucaus.', '', 'PandantivArabesque | Indira', 'Pandantiv Arabesque - Turcoaz, Coral, Lazurit', '', ''),
(43, 1, 1, '', '', 'pandantiv-rainbow', '', '', '', 'Pandantiv Rainbow', '', ''),
(43, 1, 2, '', '<p>Pandantiv din argint cu piatra Lunii. Lucrat manual in India, cu deosebita grija pentru detalii, pandantivul Rainbow Drop este format din 2 pietre Moonstone sau "Piatra Lunii" pe un suport decorativ din argint. Piatra lunii o recunoasteti dupa irezistibilul joc de lumini si dupa acea sclipire misterioasa care arata diferit din fiecare unghi.</p>', 'pandantiv-rainbow-drop', 'Lucrat manual in India, cu deosebita grija pentru detalii, pandantivul Rainbow Drop este format din 2 pietre Moonstone pe un suport decorativ din argint', '', 'Pandantiv din argint Rainbow Drop - Moonstone | Indira', 'Pandantiv Rainbow Drop', '', ''),
(44, 1, 1, '', '', 'cercei-kyanite', '', '', '', 'Cercei Kyanite', '', ''),
(44, 1, 2, '', '<p>Cercei din argint cu piatra semipretioasa din cianit, in forma de picatura. Aspectul lor vintage vor completa tinuta ta de zi, oferindu-ti un aer boem si misterios. </p>', 'cercei-vintage-drops-cianit', 'Poarta cerceii Vintage Drops de la Indira la tinutele tale de zi. Frumusetea pietrei de cianit te va face sa stralucesti cu fiecare ocazie.', '', 'Cercei din argint Vintage Drops | Indira', 'Cercei Vintage Drops - Cianit', '', ''),
(45, 1, 1, '', '', 'cercei-turcoaz-coral', '', '', '', 'Cercei Turcoaz, Coral', '', ''),
(45, 1, 2, '', '<p>Cercei din argint cu pietre de turcoaz si coral. Lucrati manual in India cu deosebita atentie la detalii, cerceii Vintage Square vin intr-o forma neobisnuita. Piatra de turcoaz slefuita in stil caboson, este incadrata de bilute rosii de coral, facand un contrast perfect cu aceasta.</p>', 'cercei-vintage-square-turcoaz-coral', 'Lucrati manual in India cu deosebita atentie la detalii, cerceii Vintage Square iti aduc un plus de originalitate cu fiecare ocazie.', '', 'Cercei din argint Vintage Square - Turcoaz, Coral | Indira', 'Cercei Vintage Square - Turcoaz, Coral', '', ''),
(46, 1, 1, '', '', 'cercei-ametist', '', '', '', 'Cercei Ametist', '', ''),
(46, 1, 2, '', '<p>Cercei din argint cu piatra Ametist, lucrati manual in India. Delicati si atent lucrati, cerceii Triangle Drops vor da un aspect vintage tinutei tale.</p>', 'cercei-triangle-drops-ametist', 'Cercei din argint cu piatra Ametist, lucrati manual in India. Delicati si atent lucrati, cerceii Triangle Drops vor da un aspect vintage tinutei tale.', '', 'Cercei din argint Triangle Drops - Ametist | Indira', 'Cercei Triangle Drops - Ametist', '', ''),
(47, 1, 1, '', '', 'cercei-black-onyx', '', '', '', 'Cercei Black Onyx', '', ''),
(47, 1, 2, '', '<p>Cercei din argint cu piatra onix negru, lucrati manual in India. Delicati si atent lucrati, cerceii Triangle Drops vor da un aspect vintage tinutei tale.</p>', 'cercei-triangle-drops-onix-negru', 'Cercei din argint cu piatra onix negru, lucrati manual in India. Delicati si atent lucrati, cerceii Triangle Drops vor da un aspect vintage tinutei tale.', '', 'Cercei din argint Triangle Drops - Onix negru | Indira', 'Cercei Triangle Drops - Onix negru', '', ''),
(48, 1, 1, '', '', 'cercei-ethiopian-opal', '', '', '', 'Cercei Ethiopian Opal', '', ''),
(48, 1, 2, '', '<p>Cercei din argint, cu piatra din Opal Etiopian, lucrati manual in India. Extrem de delicata, piatra din opal etiopian, este pusa in valoare de bilutele din argint atent lucrate. Cu un aer boem, acesti cercei sunt potriviti atat pentru tinutele de zi, cat si pentru cele de seara.</p>', 'cercei-vintage-drops-opal-etiopian', 'Cercei din argint, lucrati manual in India. Extrem de delicata, piatra din opal etiopian, este pusa in valoare de bilutele din argint atent lucrate.', '', 'Cercei din argint Vintage Drops - Opal Etiopian | Indira', 'Cercei Vintage Drops - Opal Etiopian', '', ''),
(49, 1, 1, '', '', 'cercei-mother-of-pearl', '', '', '', 'Cercei Mother of Pearl', '', ''),
(49, 1, 2, '', '<p>Cercei din filigran de argint cu sidef, lucrati manual in India. Extrem de delicati, cerceii Tear Drop pot fi purtati cu usurinta la orice tinuta de zi sau de seara.</p>', 'cercei-tear-drop-sidef', ' Extrem de delicati, cerceii Tear Drop pot fi purtati cu usurinta la orice tinuta de zi sau de seara.', '', 'Cercei argint Tear Drop Sidef | Indira', 'Cercei Tear Drop - Sidef', '', ''),
(50, 1, 1, '', '', 'cercei-malachit', '', '', '', 'Cercei Malachit', '', ''),
(50, 1, 2, '', '<p>Cercei din filigran de argint cu piatra Malachit, lucrati manual in India. Verdele intens al malachitului incadrat de filigranul de argint, te va face sa stralucesti cu fiecare ocazie.</p>', 'cercei-tear-drop-malachit', 'Cercei Malachit', '', 'Cercei Tear Drop Malachit | Indira', 'Cercei Tear Drop Malachit', '', ''),
(51, 1, 1, '', '', 'cercei-garnet', '', '', '', 'Cercei Garnet', '', ''),
(51, 1, 2, '', '<p>Cercei  din argint cu piatra Granat, lucrati cu maiestrie de ce mai iscusiti bijuterii in India. Datorita asemanarii izbitoare, aceste pietre au fost denumite Granate, din latinescul "Garanatus" care inseamna samburi de rodie. Stralucirea lor te va pune in centrul atentiei cu fiecare ocazie.</p>', 'cercei-din-argint-cu-granata', 'Cercei Garnet', '', 'Cercei Garnet', 'Cercei  din argint cu granata', '', ''),
(52, 1, 1, '', '', 'cercei-black-onyx', '', '', '', 'Cercei Black Onyx', '', ''),
(52, 1, 2, '', '<p>Cercei din argint cu piatra Onix negru, lucrati manual in India. Greu de egalat, frumusetea onixului negru este pusa in valoare de argintul lucrat cu maiestrie. Onixul negru este cunoscut inca din cele mai vechi timpuri atat pentru frumusetea sa cat si pentru puterea sa de a absorbi energia negativa si a o transforma in energie pozitiva.</p>', 'cercei-din-argint-cu-onix', 'Cercei din argint cu piatra Onix negru, lucrati manual in India. Greu de egalat, frumusetea onixului negru este cunoscuta inca din cele mai vechi timpuri.', '', 'Cercei din argint cu onix negru | Indira Bijoiux', 'Cercei  din argint cu onix', '', ''),
(53, 1, 1, '', '', 'cercei-malachite', '', '', '', 'Cercei Malachite', '', ''),
(53, 1, 2, '', '<p>Cercei din argint, tip veriga cu piatra Malachit, lucrati manual in India. Poarta cerceii cu malachit la orice tinuta de zi, si farmecul lor nu te va lasa sa treci neobservata.</p>', 'cercei-veriga-cu-malachit', 'Cercei cu piatra Malachit, lucrati manual in India. Poarta cerceii cu malachit la orice tinuta de zi, si farmecul lor nu te va lasa sa treci neobservata.', '', 'Cercei din argint cu Malachit | Indira Bijoux', 'Cercei veriga cu Malachit', '', ''),
(54, 1, 1, '', '', 'cercei-ethiopian-opal', '', '', '', 'Cercei Ethiopian Opal', '', ''),
(54, 1, 2, '', '<p>Cercei dn argint cu opal ethiopian, lucrati manual in India. Una dintre cele mai uluitoare pietre, opal ethiopian te va cuceri cu jocurile sale de culori. In timpul Imeperiului Greco-Roman, opalul ethiopian era perceput ca o piatra prometeica care a furat din focul Zeilor si l-a dat omenirii.</p>\n<p></p>', 'cercei-din-argint-cu-opal-etiopian', 'Cercei dn argint cu opal ethiopian, lucrati manual in India. Una dintre cele mai uluitoare pietre, opal ethiopian te va cuceri cu jocurile sale de culori.\r\n\r\n', '', 'Cercei din argint cu opal ethiopian | Indira Bijoux | India', 'Cercei  din argint cu Opal Etiopian', '', ''),
(55, 1, 1, '', '', 'cercei-ametist', '', '', '', 'Cercei Ametist', '', ''),
(55, 1, 2, '', '<p>Cercei din argint cu piatra Ametist, lucrati manual in India. Una dintre cele mai populare pietre, ametistul, este o piatra a spiritualitatii, care conform grecilor, este aducatoare de dragoste si fericire si apara impotriva oricarui tip de intoxicatie.</p>', 'cercei-amethyst-hearts', 'Cercei din argint cu piatra Ametist, lucrati manual in India. Una dintre cele mai populare pietre, ametistul, este o piatra a spiritualitatii.', '', 'Cercei Ametyst Hearts | IndiraBijoux', 'Cercei Amethyst Hearts', '', ''),
(56, 1, 1, '', '', 'cercei-garnet', '', '', '', 'Cercei Garnet', '', ''),
(56, 1, 2, '', '<p>Cercei din argint cu piatra de opal, lucrati cu maiestrie de cei mai iscusiti bijutieri in India. Veseli si plini de culoare, cerceii cu piatra de opal verde, iti vor accesoriza tinuta, fie ea de zi sau de seara.</p>', 'cercei-din-argint-cu-opal-verde', 'Cercei din argint cu piatra de opal, lucrati cu maiestrie in India. Veseli si plini de culoare, cerceii cu piatra de opal verde, iti vor accesoriza orice tinuta.', '', 'Cercei argint cu opal verde | Indira', 'Cercei din argint cu opal verde', '', ''),
(57, 1, 1, '', '', 'cercei-rainbow', '', '', '', 'Cercei Rainbow', '', ''),
(57, 1, 2, '', '<p>Cercei din argint cu piatra Moonstone, lucrati manual in India. Pe langa frumusetea sa deosebita, piatra lunii prinde forma unor bile de foc intarind si mai mult caracterul sau puternic. In religia hindusa, piatra lunii este asociata chakrei gatului care este centrul purificarii.</p>\n<p></p>\n<p></p>', 'cercei-rainbow-fireballs-piatra-lunii-moonstone', 'Cercei din argint cu piatra Moonstone, lucrati manual in India. De o frumusete aparte, piatra lunii este considerata a fi magica si de a avea puteri protective.', '', 'Cercei Rainbow Fireballs | Moonstone| Indira', 'Cercei Rainbow Fireballs - Piatra lunii (Moonstone)', '', ''),
(59, 1, 1, '', '', 'cercei-lapis', '', '', '', 'Cercei Lapis', '', ''),
(59, 1, 2, '', '<p>Cercei din argint cu piatra Lapis Lazuli, lucrati manual in India. Calatoreste in India si simte spiritul bollywoodian purtand aceasta superba pereche de cercei. </p>', 'cercei-indian-ethnic-lapis-lazuli', 'Cercei din argint cu piatra Lapis Lazuli, lucrati manual in India. Calatoreste in India si simte spiritul bollywoodian purtand aceasta superba pereche de cercei', '', 'Cercei Indian Ethnic | Lapis Lazuli| Indira', 'Cercei Indian Ethnic - Lapis Lazuli', '', ''),
(60, 1, 1, '', '', 'cercei-granat', '', '', '', 'Cercei Granat', '', ''),
(60, 1, 2, '', '<p>Cercei din argint cu granate, lucrati manual in India. In India Antica, pestele este simbolul transformarii si al creatiei. Mai mult decât atât, în buddhism, peștele simbolizează fericirea și libertatea.</p>', 'cercei-din-argint-cu-granate', 'Cercei din argint cu granate, lucrati manual in India. Accesorizeaza-ti tinuta de zi sau de seara cu acesti superbi cercei de la Indira.', '', 'Cercei din argint cu granate | IndiraBijoux', 'Cercei din argint cu granate', '', ''),
(61, 1, 1, '', '', 'cercei-ametist', '', '', '', 'Cercei Ametist', '', ''),
(61, 1, 2, '', '<p>Cercei din argint cu ametist, lucrati manual in India. In India Antica, pestele este simbolul transformarii si al creatiei. Mai mult decât atât, în buddhism, peștele simbolizează fericirea și libertatea.</p>', 'cercei-din-argint-cu-ametist', 'Cercei lucrati manual din argint cu piatra ametist de cei mai iscusiti bijuteri din India. Porta bijuteriile Indira pentru un plus de originalitate.', '', 'Cercei din argint cu ametist | Indira', 'Cercei din argint cu ametist', '', ''),
(62, 1, 1, '', '', 'bratara-alba-zirconia', '', '', '', 'Bratara Alba Zirconia', '', ''),
