(66, 1, 1, '', '', 'pandantiv-granat', '', '', '', 'Pandantiv Granat', '', ''),
(66, 1, 2, '', '<p>Pandantiv din argint cu Granate, lucrat manual in India. Deosebit si unic, acest pandantiv se va potrivi de minune cu rochia ta de seara sau cu camasa ta casual. Frumusetea granatelor este apreciata inca din cele mai vechi timpuri, find considerate simboluri ale<span> prieteniei eterne şi al încrederii.</span></p>', 'pandantiv-argint-cu-granate', 'Pandantiv din argint cu Granate, lucrat manual in India. Deosebit si unic, acest pandantiv se va potrivi de minune cu rochia ta de seara sau cu camasa ta casual', '', 'Pandantiv din argint cu Granate | Handmade | Indira', 'Pandantiv Argint cu Granate', '', ''),
(67, 1, 1, '', '', 'pandantiv-granat', '', '', '', 'Pandantiv Granat', '', ''),
