(68, 1, 1, '', '', 'pandantiv-corundum-verde', '', '', '', 'Pandantiv Corundum Verde', '', ''),
(68, 1, 2, '<p>Pandantivul Green Power este potrivit atat la o tinuta de zi cat si una de seara, remarcandu-se prin simplitatea si coloritul sau</p>', '<p>Pandantiv din argint cu piatra Corundum, slefuita cu pricepere de cei mai iscusiti bijutieri in India.  A doua piatra ca duritate dupa diamant, Corundum este familia safirelor si a rubinelor pentru pietrele de culoare rosie si albastra, pietrele in celelalte culori numindu-se simplu Corundum.</p>\n<p></p>', 'pandantiv-green-power-corundum', 'Pandantivul Green Power este potrivit atat la o tinuta de zi cat si una de seara, remarcandu-se prin simplitatea si coloritul sau', '', 'Pandantiv Green Power - Corundum | Indira Bijoux', 'Pandantiv Green Power - Corundum', '', ''),
(69, 1, 1, '', '', 'pandantiv-smarald', '', '', '', 'Pandantiv  Smarald', '', ''),
