(70, 1, 1, '', '', 'pandantiv-safir-albastru', '', '', '', 'Pandantiv Safir Albastru', '', ''),
(70, 1, 2, '', '<p>Pandantiv din argint cu safir, lucrat manual in India. Inca din cele mai vechi timpuri, regii purtau safire pentru a se apara de invidie si pentru a atrage putere divina. Simbol al cerurilor, safirul este recunoscut in ziua de astazi, pentru frumusetea sa de neegalat.</p>', 'pandantiv-cu-safir', 'Pandantiv din argint cu safir. Inca din cele mai vechi timpuri, regii purtau safire pentru a se apara de invidie si pentru a atrage putere divina. ', '', 'Pandantiv cu Safir | Handmade | Indira', 'Pandantiv cu Safir', '', ''),
(71, 1, 1, '', '', 'pandantiv-granat', '', '', '', 'Pandantiv  Granat', '', ''),
(71, 1, 2, '', '<p>Pandantiv din argint cu granat, lucrat manual in India. Simplu si delicat, pandantivul Vintage Drop poate fi purtat atat la tinutele de seara cat si la cele de zi.</p>', 'pandantiv-vintage-drop-granat', 'Pandantiv din argint cu granat, lucrat manual in India. Simplu si delicat, pandantivul Vintage Drop poate fi purtat  la tinutele de seara si de zi.', '', 'Pandantiv  Vintage Drop - Granat| Indira Bijoux', 'Pandantiv  Vintage Drop - Granat', '', ''),
(72, 1, 1, '', '', 'pandantiv-sidef-marcasit', '', '', '', 'Pandantiv Sidef  Marcasit', '', ''),
