(107, 1, 1, '', '', 'cercei-argint', '', '', '', 'Cercei Argint', '', ''),
(107, 1, 2, '', '<p>Cercei din argint, lucrati de cei mai iscusiti bijutieri in India. In cultura Indiei, elefantii sunt un simbol al puterii mentale si responsabilitatii iar locuitorii ei considera ca acestia sunt purtatori de noroc si prosperitate.</p>\n<p></p>', 'cercei-wild-hoops', 'Cercei Argint', '', 'Cercei Argint', 'Cercei Wild Hoops', '', ''),
(108, 1, 1, '', '', 'cercei-argint', '', '', '', 'Cercei Argint', '', ''),
