(109, 1, 2, '', '<p>Cercei din argint, lucrati manual in India. Gramezi de bilute, dispuse frumos in forma de floare, cerceii Silver Coins sunt ideali pentru un look casual dar totusi plin de stil.</p>', 'cercei-ancient-coins', 'Cercei Argint', '', 'Cercei Argint', 'Cercei Ancient Coins', '', ''),
(110, 1, 1, '', '', 'cercei-argint', '', '', '', 'Cercei Argint', '', ''),
