(113, 1, 1, '', '', 'pandantiv-shell-druzy-perla-ametist-granat', '', '', '', 'Pandantiv Shell, Druzy, Perla, Ametist, Granat', '', ''),
(113, 1, 2, '', '<p>Pandantiv din argint cu multiple pietre naturale: ametist, granat, druzy, scoica si perla. Model, unicat, pandantivul Shine Bright, este pe cat te atipic si misterios, pe atat de deosebit. Creat cu grija de cei mai iscusiti bijutierii din India, pandantivul Shine Bright este ideal pentru persoanale neconformiste, recunoscute pentru tinutele lor indraznete.</p>\n<p></p>\n<p></p>', 'pandantiv-shine-bright-druzy-scoica-perla-ametist-granat', 'Pandantiv Shell, Druzy, Perla, Ametist, Granat', '', 'Pandantiv Shell, Druzy, Perla, Ametist, Granat', 'Pandantiv Shine Bright - Druzy, Scoica, Perla, Ametist, Granat', '', ''),
(114, 1, 1, '', '', 'pandantiv-druzy-perla-ametist-garnat', '', '', '', 'Pandantiv Druzy, Perla, Ametist, Garnat', '', ''),
(114, 1, 2, '', '<p>Pandantiv din argint cu multiple pietre naturale: ametist, granat, druzy, scoica si perla. Model, unicat, pandantivul Shining Square, este pe cat te atipic si misterios, pe atat de deosebit. Creat cu grija de cei mai iscusiti bijutierii din India, pandantivul Shining Square este ideal pentru persoanale neconformiste, recunoscute pentru tinutele lor indraznete.</p>', 'pandantiv-shining-square-druzy-perla-ametist-granat', 'Pandantiv Druzy, Perla, Ametist, Garnat', '', 'Pandantiv Druzy, Perla, Ametist, Garnat', 'Pandantiv Shining Square -Druzy, Perla, Ametist, Granat', '', ''),
(115, 1, 1, '', '', 'pandantiv-turcoaz-shell-coral-lapislazuli', '', '', '', 'Pandantiv Turcoaz, Shell, Coral, Lapislazuli', '', ''),
(115, 1, 2, '', '<p>Pandantiv din argint cu multiple pietre naturale: Lapis Lazuli, scoica, coral, turcoaz. Model unicat, pandantivul Color MIx este lucrat manual in India, de cei mai iscusiti bijutieri. Lucratura deosebita din argint si pietre, asemenea unei capodopere de arta, poate fi purtata la acele tinutele indraznete care vor fi mereu in centrul atentiei.</p>', 'pandantiv-color-mix-turcoaz-scoica-lazurit-coral', 'Pandantiv Turcoaz, Shell, Coral, Lapislazuli', '', 'Pandantiv Turcoaz, Shell, Coral, Lapislazuli', 'Pandantiv Color Mix -Turcoaz, Scoica, Lazurit, Coral', '', ''),
