(119, 1, 2, '', '<p>Cercei din argint, stil catuse. Micuti si draguti, cerceii Pearl Cuff sunt potriviti pentru o tinuta casual, simpla dar totusi stilata.</p>', 'cercei-pearl-cuffs', 'Cercei Argint', '', 'Cercei Argint', 'Cercei Pearl Cuffs', '', ''),
(120, 1, 1, '', '', 'inel-reglabil', '', '', '', 'Inel Reglabil', '', ''),
