(121, 1, 1, '', '', 'colier-argint', '', '', '', 'Colier Argint', '', ''),
(121, 1, 2, '<p>Lungime: 38-43 cm</p>', '<p>Colier din argint, Thailanda. Acest colier elegant din argint iti va aduce un plus de feminitate de fiecare data cand il vei purta.</p>\n<p></p>', 'colier-din-argint-cu-zirconiu', 'Colier Argint', '', 'Colier Argint', 'Colier din argint cu zirconiu', '', ''),
(122, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
