(127, 1, 1, '', '', 'pandantiv-argint', '', '', '', 'Pandantiv Argint', '', ''),
(127, 1, 2, '<p>Latime: 30 mm</p>\n<p>Inaltime: 40 mm</p>', '<p>Pandantiv din argint cu simbolurile zodiacului. Indrazneste sa-ti arati adevarata personalitate si autenticitate si accesorizeaza-te cu acele bijuterii care te reprezinta cel mai bine. Daca esti pasionata de zodiac dar iti plac in acelasi timp bijuteriile impunatoare, frumos finisate din argint, pandantivul Zodiac este alegerea cea mai buna pentru tine.</p>', 'pandantiv-zodiac', 'Pandantiv Argint', '', 'Pandantiv Argint', 'Pandantiv Zodiac', '', ''),
(128, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
