(132, 1, 1, '', '', 'colier-argint', '', '', '', 'Colier Argint', '', ''),
(132, 1, 2, '', '<p>Colier din argint, in stil boho-chic. Elegant si feminin, colierul Charming Diva poate fi purtat cu o rochie de seara ori cu un top satinat si decoltat. Cu siguranta va atrage toate privirile.</p>', 'colier-charming-diva', 'Colier Argint', '', 'Colier Argint', 'Colier Charming Diva', '', ''),
(133, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
