(137, 1, 1, '', '', 'bratara-argint', '', '', '', 'Bratara Argint', '', ''),
(137, 1, 2, '', '<p>Bratara din argint, in stil boho-chic. Simpla, totusi feminina si plina de stil, bratara Pulse Rate<span> este potrivita atat tinutelor de zi cat si celor de seara.</span></p>', 'bratara-pulse-rate', 'Bratara Argint', '', 'Bratara Argint', 'Bratara Pulse Rate', '', ''),
(138, 1, 1, '', '', 'cercei-argint', '', '', '', 'Cercei Argint', '', ''),
(138, 1, 2, '', '<p>Cercei din argint, in still boho-chic. Jucausi si cu personalitate, cerceii Lace Chandeliers sunt ideali pentru persoanele vesele si pline de incredere. Accesorizeaza-ti tinutele de zi sau de seara cu cerceii Lace Chandeliers, si vei intoarce toate privirile.</p>', 'cercei-lace-chandeliers', 'Cercei Argint', '', 'Cercei Argint', 'Cercei Lace Chandeliers', '', ''),
(139, 1, 1, '', '', 'pandantiv-argint', '', '', '', 'Pandantiv Argint', '', ''),
