(140, 1, 1, '', '', 'bratara-argint', '', '', '', 'Bratara Argint', '', ''),
(140, 1, 2, '', '<p>Bratara din argint, in stil bangle. Flexibila si usor de dimensionat, aceasta bratara va atrage toate privirile indiferent daca este purtata singura sau in combinatie cu alte bratari. </p>', 'bratara-bangle-rope', 'Bratara Argint', '', 'Bratara Argint', 'Bratara Bangle Rope', '', ''),
(141, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(141, 1, 2, '', '<p><span>Inel din argint, in stil minimalist. Simplu dar de efect, inelu poate fi purtat singur sau in combinatie cu alte inele, atat la o tinuta casual cat si la una de ocazie.</span></p>', 'inel-triple-sign', 'Inel Argint', '', 'Inel Argint', 'Inel Triple Sign', '', ''),
(142, 1, 1, '', '', 'bratara-argint', '', '', '', 'Bratara Argint', '', ''),
(142, 1, 2, '', '<p>Bratara din argint, tip bangle. Flexibila si usor de dimensionat, bratara Inspiration Cuff poate fi purtata singura sau in combinatie cu alte bratari pentru un look perfect. Ea este potrivita atat pentru tinutele de seara cat si cele de zi.</p>', 'bratara-inspiration-cuff', 'Bratara Argint', '', 'Bratara Argint', 'Bratara Inspiration Cuff', '', ''),
(143, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(143, 1, 2, '', '<p>Inel din argint, in stil minimalist. <span>Simplu dar de efect, inelul poate fi purtat singur sau in combinatie cu alte inele pentru un look perfect atat la tinutele de seara cat si cele de zi.</span></p>', 'inel-fancy-cocktail', '54-706-21856', '', '', 'Inel  Fancy Cocktail', '', ''),
(144, 1, 1, '', '', 'cercei-argint', '', '', '', 'Cercei Argint', '', ''),
(144, 1, 2, '', '<p>Cercei din argint, in stil minimalist. Simpli dar totusi plini de stil, cerceii Silver Drops sunt acel accesoriu de care te vei indragosti si nu-i vei mai da jos de la urechi. Pot fi purtati la tinutele casual, de zi.</p>', 'cercei-silver-drops', 'Cercei Argint', '', 'Cercei Argint', 'Cercei Silver Drops', '', ''),
(145, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(145, 1, 2, '', '<p>Inel din argint, in stil minimalist. Simplu dar elegant, inelul Multi Shape poate fi purtat singur sau in combinatie cu alte inele pentru un look plin de autenticitate atat la tinutele de zi cat si cele de seara.</p>', 'inel-multi-shape', 'Inel Argint', '', 'Inel Argint', 'Inel Multi Shape', '', ''),
(146, 1, 1, '', '', 'bratara-argint', '', '', '', 'Bratara Argint', '', ''),
(146, 1, 2, '', '<p>Bratara din argint, tip catuse. Fii in trend cu moda si poarta bratara Heart Cuffs la tinutele de zi, si cu siguranta vei atrage toate privirile. Un model simplu, dar totusi rafinat iti va da un aer boem, sofisticat.</p>', 'bratara-heart-cuffs', 'Bratara Argint', '', 'Bratara Argint', 'Bratara Heart Cuffs', '', ''),
(147, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(147, 1, 2, '<p>Marime: 6 pana la 9.</p>', '<p>Inel din argint, reglabil. Plin de personalitate, inelul Glam Night este acea bijuterie de care nu ai cum sa nu te indragostesti. Potrivit pentru tinutele de seara si de ocazie, inelul Glam Night va cuceri toate privirile.</p>', 'inel-glam-night', 'Inel Argint', '', 'Inel Glam Night - Bijuterii din argint | Indira', 'Inel Glam Night', '', ''),
(148, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(148, 1, 2, '', '<p><span>Inel din argint, in stil minimalist. Simplu dar de efect, inelu poate fi purtat singur sau in combinatie cu alte inele, atat la o tinuta casual cat si la o tinuta de ocazie.</span></p>', 'inel-silver-spring', 'Inel Argint', '', 'Inel Argint', 'Inel Silver Spring', '', ''),
(149, 1, 1, '', '', 'inel-argint', '', '', '', 'Inel Argint', '', ''),
(149, 1, 2, '', '<p><span>Inel din argint, in stil minimalist. Simplu dar de efect, inelu poate fi purtat singur sau in combinatie cu alte inele, atat la o tinuta casual cat si la o tinuta de ocazie.</span></p>', 'inel-empty-triangle', 'Inel Argint', '', 'Inel Argint', 'Inel Empty Triangle', '', ''),
